#include<iostream>
#include<vector>
#include<queue>
#include<string>
using namespace std;

//Given a 2D board containing 'X' and 'O', capture all regions surrounded by 'X'.
//A region is captured by flipping all 'O's into 'X's in that surrounded region.
//For example,          After running your function, the board should be: 
//X X X X                                               X X X X
//X O O X                                               X X X X
//X X O X                                               X X X X
//X O X X                                               X O X X

//http://www.2cto.com/kf/201409/333055.html
// Scans from edges of the board, if the char is 'O', mark it as '#', then search four char around it, until no 'O' is got.
//Finally, scan all char in board, if '#', replace with 'O'; if 'O', replace with 'X'.
//x-----cols ,    y-----rows
class Solution {
public:
	/*
	void DFS(int x, int y,  vector<vector<char> >&board){
		  if( x >= cols || x < 0 || y >= rows || y < 0)
			  return;
		  if( board[y][x] != 'O')
			  return;
		  board[y][x] = '#';
		  DFS(x-1,  y, board);  //left
		  DFS(x+1, y, board);  //right
		  DFS(x, y-1, board);  //down
		  DFS(x, y+1, board); //up
	}
	*/
	struct point{
		int x;
		int y;
		point(): x(-1), y(-1){};
		point(int x1, int y1): x(x1), y(y1){}
	};

	//BFS using queue, not recursion.
	void BFS(int x, int y, vector<vector<char> >&board){
		if(board[y][x] != 'O') 
			return;
		 int dirX[4] = {-1, 0,  1, 0};
		 int dirY[4] = { 0, -1, 0, 1};
		 vector<vector<bool> > isVisted(rows, vector<bool>(cols, false));
		 board[y][x] = '#';
		 isVisted[y][x] = true;
		 queue<point> path;
		 path.push(point(x,y));
		 point curPoint, nextPoint;
		 while( ! path.empty() ){
			 curPoint = path.front();
			 path.pop();
			 for(int i = 0; i < 4; ++i){
				 nextPoint.x = curPoint.x + dirX[i];
				 nextPoint.y = curPoint.y + dirY[i];
				 if(nextPoint.x  >= 0 && nextPoint.x < cols && nextPoint.y >= 0 && nextPoint.y < rows
					    && !isVisted[nextPoint.y][nextPoint.x] &&  board[nextPoint.y][nextPoint.x] == 'O')
				 {
					   board[nextPoint.y][nextPoint.x] = '#';
					   isVisted[nextPoint.y][nextPoint.x] = true;
					   path.push(nextPoint);
				 }
			 }
		 } // end while
	}
    void solve(vector<vector<char>> &board) {
		if(board.size() == 0 || board[0].size() == 0)
			return;
		rows = board.size();
		cols = board[0].size();
		for(int i = 0; i < cols; ++i){
			BFS( i, 0, board);              //top
			BFS( i,  rows-1, board);    //bottom
		}
		for(int j = 0; j < rows; ++j){
			BFS(0,  j,  board);            //left
			BFS(cols-1,  j,  board);   //right
		}
		for(int i = 0; i < rows; ++i){
			for(int j = 0; j < cols; ++j)
				if(board[i][j] == '#')
					board[i][j] = 'O';
				else if(board[i][j] == 'O')
					board[i][j] = 'X';
		}
    }

private:
	int rows;
	int cols;
};


int main(){
	Solution s;

	/*
	char str[3][3] = { {'O', 'O', 'O'},
                                  {'O', 'O', 'O'},
                                  {'O', 'O', 'O'} };
	
	char str[4][4] = { {'X', 'X', 'X', 'X'},
                                  {'X', 'O', 'O', 'X'},
                                  {'X', 'X', 'O', 'X'},
								  {'X', 'O', 'X', 'X'} };
   */
	char str[4][6] ={ {'X', 'O', 'X', 'O', 'X', 'O'},
                                 {'O', 'X', 'O', 'X', 'O', 'X'},
                                 {'X', 'O', 'X', 'O', 'X', 'O'},
	                             {'O', 'X', 'O', 'X', 'O', 'X'} };
	
	vector<vector<char> > board;
	vector<char> line;
	for(int i =0; i< 4; ++i){
		for(int j = 0; j < 6; ++j)
			line.push_back(str[i][j]);
		board.push_back(line);
		line.clear();
	}
	s.solve(board);
	getchar();
	return 0;
}


